import React,{Component} from 'react'
class Body_Laptopgaming01 extends Component {
    render() {
        return(
            <div className="breadcrumb parallax-container">
            <div className="parallax"><img src="image/prlx.jpg" alt="#" /></div>
            <h1 className="category-title">Sản phẩm</h1>
            <ul>
              
              <li><a href="laptopGaming.html">Laptop văn phòng</a></li>
            </ul>
          </div>
        );
    }
}

export default Body_Laptopgaming01
